		"BasicLine.html": "<ExtContainer [padding]=\"!isPhone ? '10': ''\" layout=\"vbox\" [fitToParent]=\"true\">\n\n  <ExtContainer><div #extitem>\n    <chart-toolbar\n      [onThemeChange]=\"this.changeTheme\"\n      [theme]=\"theme\">\n    </chart-toolbar>\n  </div></ExtContainer>\n\n  <ExtCartesian downloadServerUrl =\"http:\/\/svg.sencha.io\"\n    flex=\"1\"\n    shadow=\"true\"\n    insetPadding=\"40 40 60 40\"\n    [store]=\"this.store\"\n    [theme]=\"theme\"\n    [series]=\"cartesianSeries\"\n    [axes]=\"cartesianAxes\">\n  </ExtCartesian>\n\n</ExtContainer>"
