		"Spline.html": "<ExtContainer padding=\"10\" layout=\"vbox\" [fitToParent]=\"true\">\n\n  <ExtContainer><div #extitem>\n    <chart-toolbar\n      [onThemeChange]=\"this.changeTheme\"\n      [theme]=\"theme\">\n    </chart-toolbar>\n  </div></ExtContainer>\n\n  <ExtCartesian downloadServerUrl =\"http:\/\/svg.sencha.io\"\n    flex=\"1\"\n    shadow=\"true\"\n    [store]=\"this.store\"\n    [theme]=\"theme\"\n    insetPadding=\"20 20 0 0\"\n    [axes]=\"cartesianAxes\"\n    [series]=\"cartesianSeries\">\n  </ExtCartesian>\n\n</ExtContainer>"
