		"SplineMarkers.ts": "declare var Ext: any;\nimport { Component } from '@angular/core';\nimport { storeData } from './storeData';\n\n@Component({\n  selector: 'SplineMarkers-component',\n  templateUrl: './SplineMarkers.html',\n  styles: [``]\n})\nexport class SplineMarkersComponent {\n\n  constructor() {\n  }\n\n  isPhone: boolean = Ext.os.is.Phone;\n\n  store = Ext.create('Ext.data.Store', {\n    fields: ['theta', 'sin', 'cos', 'tan'],\n    data: storeData\n  });\n\n  theme: string = 'default';\n\n  changeTheme = theme => this.theme = theme;\n\n  cartesianAxes = [{\n    type: 'numeric',\n    fields: ['sin', 'cos', 'tan'],\n    position: 'left',\n    grid: true,\n    renderer: (axis, label) => Ext.util.Format.number(label, '0.0')\n  }, {\n    type: 'category',\n    title: 'Theta',\n    fields: 'theta',\n    position: 'bottom',\n    style: {\n      textPadding: 0 \/\/ remove extra padding between labels to make sure no labels are skipped\n    },\n    grid: true,\n    label: {\n      rotate: {\n        degrees: -45\n      }\n    }\n  }];\n\n  cartesianSeries = [{\n    type: 'line',\n    xField: 'theta',\n    yField: 'sin',\n    smooth: true,\n    style: {\n      lineWidth: 2\n    },\n    marker: {\n      radius: 4\n    },\n    highlight: {\n      fillStyle: '#000',\n      radius: 5,\n      lineWidth: 2,\n      strokeStyle: '#fff'\n    }\n  }, {\n    type: 'line',\n    xField: 'theta',\n    yField: 'cos',\n    smooth: true,\n    style: {\n      lineWidth: 2\n    },\n    marker: {\n      radius: 4\n    },\n    highlight: {\n      fillStyle: '#000',\n      radius: 5,\n      lineWidth: 2,\n      strokeStyle: '#fff'\n    }\n  }, {\n    type: 'line',\n    xField: 'theta',\n    yField: 'tan',\n    smooth: true,\n    style: {\n      lineWidth: 2\n    },\n    marker: {\n      radius: 4\n    },\n    highlight: {\n      fillStyle: '#000',\n      radius: 5,\n      lineWidth: 2,\n      strokeStyle: '#fff'\n    }\n  }];\n\n}",
