		"ContainerField.html": "<ExtContainer padding=\"10\" layout=\"fit\" [fitToParent]=\"true\">\n    <ExtFormpanel\n        [shadow]=\"true\"\n        [top]=\"top\"\n        [left]=\"left\"\n        [width]=\"width\"\n        [height]=\"height\"\n        [layout]=\"{ type: 'vbox', align: 'left' }\"\n        [bodyPadding]=\"10\"\n        [defaults]=\"{ labelAlign: 'left', labelTextAlign: 'right' }\"\n    >\n        <ExtContainer>\n            <span #extitem>\n                <b>ContainerField</b> allows you to apply a single label to\n                multiple fields. This is especially useful for groups of\n                checkboxes, radio buttons, and other compound fields.\n            </span>\n        </ExtContainer>\n\n        <ExtContainerfield\n            [label]=\"'Name'\"\n            [layout]=\"isPhone ? 'vbox' : 'vbox'\"\n            [defaults]=\"{ labelAlign: 'bottom' }\"\n        >\n            <ExtTextfield [label]=\"'First'\"></ExtTextfield>\n            <ExtTextfield [label]=\"'Middle'\"></ExtTextfield>\n            <ExtTextfield [label]=\"'Last'\"></ExtTextfield>\n        </ExtContainerfield>\n\n        <ExtContainerfield\n            [label]=\"'Vehicle Class'\"\n            [layout]=\"{ type: 'vbox', align: 'left' }\"\n            [defaults]=\"{ margin: '0' }\"\n        >\n            <ExtRadio [boxLabel]=\"'Compact'\" [name]=\"'priority'\"></ExtRadio>\n            <ExtRadio [boxLabel]=\"'Mid-size'\" [name]=\"'priority'\"></ExtRadio>\n            <ExtRadio [boxLabel]=\"'SUV'\" [name]=\"'priority'\"></ExtRadio>\n        </ExtContainerfield>\n\n        <ExtContainerfield\n            [label]=\"'Options'\"\n            [layout]=\"{ type: 'vbox', align: 'left' }\"\n        >\n            <ExtCheckbox [boxLabel]=\"'A/C'\"></ExtCheckbox>\n            <ExtCheckbox [boxLabel]=\"'Leather'\"></ExtCheckbox>\n            <ExtCheckbox [boxLabel]=\"'Nav'\"></ExtCheckbox>\n        </ExtContainerfield>\n    </ExtFormpanel>\n</ExtContainer>\n"
