		"hboxLayout.html": "<ExtContainer  [padding]=\"isPhone ? 20 : 30\">\n    <ExtPanel\n        [shadow]=\"true\" [ui]=\"'instructions'\" [margin]=\"'0 0 40 0'\"\n        [html]=\"'An <b>hbox</b> layout positions items horizontally with optional \\'pack\\', and \\'align\\' configs.'\"\n    ></ExtPanel>\n    <ExtContainer  [style]=\"{fontSize:14, fontFamily:'Menlo, Courier', margin:'20px 0 8px'}\"\n        html=\"<div>align: 'stretch'</div>\"\n    ></ExtContainer>\n    <ExtPanel  [shadow]=\"true\" [layout]=\"{ type: 'hbox', align: 'strech' }\" [height]=\"75\" [margin]=\"'0 0 40 0'\">\n        <ExtContainer  [layout]=\"'center'\" [style] =\"colors.card.red\" [flex]=\"1\" [html]=\"'Item 1'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style] =\"colors.card.blue\" [flex]=\"1\" [html]=\"'Item 2'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style] =\"colors.card.green\" [flex]=\"1\" [html]=\"'Item 3'\"></ExtContainer>\n    </ExtPanel>\n    <ExtContainer  [style]=\"{fontSize:14, fontFamily:'Menlo, Courier', margin:'20px 0 8px'}\"\n        html=\"<div>align: 'top'</div>\"\n    ></ExtContainer>\n    <ExtPanel  [shadow]=\"true\" [layout]=\"{ type: 'hbox', align: 'top' }\" [height]=\"75\" [margin]=\"'0 0 40 0'\">\n        <ExtContainer  [layout]=\"'center'\" [style] =\"colors.card.red\" [flex]=\"1\" [html]=\"'Item 1'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style] =\"colors.card.blue\" [flex]=\"1\" [html]=\"'Item 2'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style] =\"colors.card.green\" [flex]=\"1\" [html]=\"'Item 3'\"></ExtContainer>\n    </ExtPanel>\n    <ExtContainer  [style]=\"{fontSize:14, fontFamily:'Menlo, Courier', margin:'20px 0 8px'}\"\n        html=\"<div>align: 'bottom'</div>\"\n    ></ExtContainer>\n    <ExtPanel  [shadow]=\"true\" [layout]=\"{ type: 'hbox', align: 'bottom' }\" [height]=\"75\" [margin]=\"'0 0 40 0'\">\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.red\" flex=\"1\" [html]=\"'Item 1'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.blue\" flex=\"1\" [html]=\"'Item 2'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.green\" flex=\"1\" [html]=\"'Item 3'\"></ExtContainer>\n    </ExtPanel>\n    <ExtContainer\n        [style]=\"{fontSize:14, fontFamily:'Menlo, Courier', margin:'20px 0 8px'}\"\n        html=\"<div>pack: 'start'</div>\"\n    ></ExtContainer>\n    <ExtPanel  [shadow]=\"true\" [layout]=\"{ type: 'hbox', pack: 'start' }\" [height]=\"75\" [margin]=\"'0 0 40 0'\">\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.red\" [html]=\"'Item 1'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.blue\" [html]=\"'Item 2'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.green\" [html]=\"'Item 3'\"></ExtContainer>\n    </ExtPanel>\n    <ExtContainer\n        [style]=\"{fontSize:14, fontFamily:'Menlo, Courier', margin:'20px 0 8px'}\"\n        html=\"<div>pack: 'center'</div>\"\n    ></ExtContainer>\n    <ExtPanel  [shadow]=\"true\" [layout]=\"{ type: 'hbox', pack: 'center' }\" [height]=\"75\" [margin]=\"'0 0 40 0'\">\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.red\" [html]=\"'Item 1'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.blue\" [html]=\"'Item 2'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.green\" [html]=\"'Item 3'\"></ExtContainer>\n    </ExtPanel>\n    <ExtContainer\n        [style]=\"{fontSize:14, fontFamily:'Menlo, Courier', margin:'20px 0 8px'}\"\n        html=\"<div>pack: 'end'</div>\"\n    ></ExtContainer>\n    <ExtPanel  [shadow]=\"true\" [layout]=\"{ type: 'hbox', pack: 'end' }\" [height]=\"75\" [margin]=\"'0 0 40 0'\">\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.red\" [html]=\"'Item 1'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.blue\" [html]=\"'Item 2'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.green\" [html]=\"'Item 3'\"></ExtContainer>\n    </ExtPanel>\n    <ExtContainer\n        [style]=\"{fontSize:14, fontFamily:'Menlo, Courier', margin:'20px 0 8px'}\"\n        html=\"<div>pack: 'space-between'</div>\"\n    ></ExtContainer>\n    <ExtPanel  [shadow]=\"true\" [layout]=\"{ type: 'hbox', pack: 'space-between' }\" [height]=\"75\" [margin]=\"'0 0 40 0'\">\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.red\" [html]=\"'Item 1'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.blue\" [html]=\"'Item 2'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.green\" [html]=\"'Item 3'\"></ExtContainer>\n    </ExtPanel>\n    <ExtContainer\n        [style]=\"{fontSize:14, fontFamily:'Menlo, Courier', margin:'20px 0 8px'}\"\n        html=\"<div>pack: 'space-around'</div>\"\n    ></ExtContainer>\n    <ExtPanel  [shadow]=\"true\" [layout]=\"{ type: 'hbox', pack: 'space-around' }\" [height]=\"75\" [margin]=\"'0 0 40 0'\">\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.red\" [html]=\"'Item 1'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.blue\" [html]=\"'Item 2'\"></ExtContainer>\n        <ExtContainer  [layout]=\"'center'\" [style]=\"colors.card.green\" [html]=\"'Item 3'\"></ExtContainer>\n    </ExtPanel>\n</ExtContainer>\n"
