		"DesktopTabs.ts": "declare var Ext: any;\nimport { Component } from '@angular/core'\n\n@Component({\n  selector: 'desktoptab-component',\n  templateUrl: \"./DesktopTabs.html\",\n  styles: [``]\n})\nexport class DesktopTabsComponent {\n}\n",
		"DesktopTabs.html": "<ExtContainer padding=\"10\" layout=\"fit\" [fitToParent]=\"true\">\n    <ExtTabpanel\n        [flex]=\"1\"\n        [shadow]=\"true\"\n        [tabBar]=\"{ layout: { pack: 'left' } }\"\n    >\n        <ExtPanel\n            [flex]=\"1\"\n            [title]=\"'Tab 1'\"\n            [layout]=\"'center'\"\n\n        >\n            <ExtContainer\n                [html]=\"\n                    'When optimizing for desktops, you may want to tabs on the left side of the tab bar.  You can do this by setting <code>pack: \\'left\\'</code> in the tab bar\\'s layout config.'\n                \"\n            ></ExtContainer>\n        </ExtPanel>\n        <ExtPanel\n            [flex]=\"1\"\n            [title]=\"'Tab 2'\"\n            [layout]=\"'center'\"\n\n        >\n            <ExtContainer\n                [cls]=\"'action'\"\n                [html]=\"'User tapped Tab 2'\"\n            ></ExtContainer>\n        </ExtPanel>\n        <ExtPanel\n            [flex]=\"1\"\n            [title]=\"'Tab 3'\"\n            [layout]=\"'center'\"\n            \n        >\n            <ExtContainer\n                [cls]=\"'action'\"\n                [html]=\"'User tapped Tab 3'\"\n            ></ExtContainer>\n        </ExtPanel>\n    </ExtTabpanel>\n</ExtContainer>\n"
