		"ScrollingTabs.ts": "declare var Ext: any;\nimport { Component } from '@angular/core'\n\nExt.require('Ext.layout.overflow.Scroller');\n\n@Component({\n  selector: 'scrollingtab-component',\n  templateUrl: \"./ScrollingTabs.html\",\n  styles: [``]\n})\nexport class ScrollingTabsComponent {\n}\n",
		"ScrollingTabs.html": "<ExtContainer padding=\"10\" layout=\"fit\" [fitToParent]=\"true\">\n    <ExtTabpanel\n        [width]=\"400\"\n        [flex]=\"1\"\n        [shadow]=\"true\"\n        [tabBar]=\"{ layout: { pack: 'start', overflow: 'scroller' } }\"\n        [defaults]=\"{ layout: 'center', cls: 'card', bodyPadding: 0 }\"\n    >\n        <ExtPanel\n            [flex]=\"1\"\n            [title]=\"'Home'\"\n            [layout]=\"'center'\"\n            [width]=\"100\"\n        >\n            <ExtContainer\n                [width]=\"'100%'\"\n                [html]=\"\n                    'You can set <code>{layout: { overflow: \\'scroller\\' }}</code> on the <code>tabBar</code> prop in combination with a <code>minWidth</code> on each tab to make the tab bar scroll when it runs out of room.'\n                \"\n            ></ExtContainer>\n        </ExtPanel>\n        <ExtPanel [flex]=\"1\" [title]=\"'Politics'\" [layout]=\"'center'\"\n            ><ExtContainer [html]=\"'Politics'\"></ExtContainer\n        ></ExtPanel>\n        <ExtPanel [flex]=\"1\" [title]=\"'Entertainment'\" [layout]=\"'center'\"\n            ><ExtContainer\n                [width]=\"'100%'\"\n                [html]=\"'Entertainment'\"\n            ></ExtContainer\n        ></ExtPanel>\n        <ExtPanel [flex]=\"1\" [title]=\"'World'\" [layout]=\"'center'\"\n            ><ExtContainer [width]=\"'100%'\" html=\"World\"></ExtContainer\n        ></ExtPanel>\n        <ExtPanel [flex]=\"1\" [title]=\"'Markets'\" [layout]=\"'center'\"\n            ><ExtContainer [width]=\"'100%'\" html=\"Markets\"></ExtContainer\n        ></ExtPanel>\n        <ExtPanel [flex]=\"1\" [title]=\"'Sports'\" [layout]=\"'center'\"\n            ><ExtContainer [width]=\"'100%'\" html=\"Sports\"></ExtContainer\n        ></ExtPanel>\n    </ExtTabpanel>\n</ExtContainer>\n"
